webpackJsonp([826614329757],{7412:function(t,e){t.exports={data:{post:{html:'<blockquote>We went down to the courthouse<br />\nand the judge put it all to rest<br />\nNo wedding day smiles no walk down the aisle<br />\nNo flowers no wedding dress</p></blockquote>\n<p>That was twenty-two years ago. Tonight we are getting together after work, leaving Christopher with his Oma, and driving off together to.... a parent-teacher meeting at the kindergarten that neither of us really wants to attend.</p>\n<p>We really know <a href="http://www.papascott.de/archives/2000/09/06/">how</a> <a href="http://www.papascott.de/archives/2001/09/06/">to</a> <a href="http://www.papascott.de/archives/2002/09/07/">celebrate</a> <a href="http://www.papascott.de/archives/2003/09/08/">our</a> anniversary, don\'t we? Or <a href="http://www.papascott.de/archives/2004/09/06/">not</a>.</p>',fields:{title:"Twenty-Two Years",date:"06 Sep 2005",url:"https://papascott.de/2005-09-06-twenty-two-years/"}}},pathContext:{slug:"/2005-09-06-twenty-two-years/",prev:{fields:{title:"Noone Saw It Coming",date:"06 Sep 2005",slug:"/2005-09-06-noone-saw-it-coming/"}},next:{fields:{title:"Nazi sabotage from beyond the grave",date:"09 Sep 2005",slug:"/2005-09-09-nazi-sabotage-from-beyond-the-grave/"}}}}}});
